const selectColor = (color) => {
  console.log(color);
};

const Palette = ({ palette, selectColor }) => {
  return (
    <div className="palette-container">
      {palette.map((item) => (
        <div
          className="palette-unit"
          style={{ backgroundColor: item.color }}
          onClick={selectColor}
        ></div>
      ))}
    </div>
  );
};

export default Palette;
